signatures: >-
  get_bank_branches(bank_id: int) -> list[dict] - Retrieve bank branches
  information based on bank ID.

  get_bank_financials(bank_id: int) -> list[dict] - Retrieve financial
  information for a bank based on bank ID.

  get_bank_id_by_name(name: str) -> int - Retrieve bank ID based on the bank's
  name.

  create_workbook() -> openpyxl.Workbook - Create a new Excel workbook.

  auto_size_column_width(worksheet: openpyxl.worksheet.worksheet.Worksheet) ->
  None - Adjust column widths in a worksheet based on cell content.

  add_worksheet(workbook: openpyxl.Workbook, sheet_name: str) ->
  openpyxl.worksheet.worksheet.Worksheet - Add a new worksheet to the workbook.

  add_table_rows(worksheet: openpyxl.worksheet.worksheet.Worksheet, start_row:
  int, start_col: int, rows: list[list], formats: list[str] = None) -> None -
  Add rows of data to the worksheet starting at a specific row and column, with
  optional cell formatting.

  add_table_header(worksheet: openpyxl.worksheet.worksheet.Worksheet, row: int,
  col: int, column_names: list[str]) -> None - Add a header row with styled
  column names to the worksheet.
